import React, { useState } from 'react';
import styled from 'styled-components';
import Friend from './Friend';

const FriendsListBlock = styled.div`
  width: 45%;
  max-height: 650px;
  border: 1px solid black;
  overflow-y: auto;
`;

const friendsList = [
  {
    profileImage: '1646621980718.jpeg',
    nickname: '123',
    tags: ['운동', '영화', '축구', '강아지랑 산책'],
  },
  { profileImage: '1646702364540.jpeg', nickname: 'nani' },
  { nickname: 'abcd' },
];

const FriendsList = () => {
  return (
    <FriendsListBlock>
      {friendsList.map((friend) => (
        <Friend profileImage={friend.profileImage} nickname={friend.nickname} />
      ))}
    </FriendsListBlock>
  );
};

export default FriendsList;
